CREATE TABLE mytable(
   id            INTEGER  NOT NULL PRIMARY KEY 
  ,name          VARCHAR(12) NOT NULL
  ,species       VARCHAR(51) NOT NULL
  ,type1         VARCHAR(8) NOT NULL
  ,type2         VARCHAR(8)
  ,abilities0    VARCHAR(16) NOT NULL
  ,abilities1    VARCHAR(15)
  ,hp            INTEGER  NOT NULL
  ,defense       INTEGER  NOT NULL
  ,spDefense     INTEGER  NOT NULL
  ,attack        INTEGER  NOT NULL
  ,spAttack      INTEGER  NOT NULL
  ,speed         INTEGER  NOT NULL
  ,statTotal     INTEGER  NOT NULL
  ,eggCycle      INTEGER  NOT NULL
  ,catchRate     INTEGER  NOT NULL
  ,height        NUMERIC(4,1) NOT NULL
  ,weight        NUMERIC(5,1) NOT NULL
  ,mRatio        NUMERIC(4,1) NOT NULL
  ,fRatio        NUMERIC(4,1) NOT NULL
  ,generation    INTEGER  NOT NULL
  ,eggGroup1     VARCHAR(12) NOT NULL
  ,eggGroup2     VARCHAR(10)
  ,legendary     VARCHAR(5) NOT NULL
  ,colour        VARCHAR(6) NOT NULL
  ,evolutionLine INTEGER  NOT NULL
  ,abilities2    VARCHAR(12)
  ,abilities3    VARCHAR(12)
  ,abilities4    VARCHAR(13)
  ,abilities5    VARCHAR(16)
);
